INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (29001, 3, 0, 0.0, "2030/12/17 14:59:59", -409.0, 29, 0, 1, 190801, 0.0, 1, "カリン", "2019/09/24 15:00:00", "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！");
