INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (31001, 7, 0, 0.0, "2030/12/17 14:59:59", -409.0, 31, 0, 1, 190801, 0.0, 1, "カリン", "2019/10/31 12:00:00", "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！");
