INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (41004, 1, 0, 0.0, "2030/12/17 14:59:59", -363.0, 41, 0, 1, 105901, 0.0, 1, "コッコロ", "2015/12/17 15:00:00", "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。");
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (42001, 1, 0, 0.0, "2030/12/17 14:59:59", -416.5, 42, 0, 1, 105901, 0.0, 1, "コッコロ", "2015/12/17 15:00:00", "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。");
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (42002, 1, 2104010, 0.0, "2030/12/17 14:59:59", -416.5, 42, 0, 1, 106401, 0.0, 1, "シェフィ", "2015/12/17 15:00:00", "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。");
