INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (43001, 1, 0, 0.0, "2030/12/17 14:59:59", -363.0, 43, 0, 1, 105801, 0.0, 1, "ペコリーヌ", "2015/12/17 15:00:00", "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！");
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (43002, 1, 0, 0.0, "2030/12/17 14:59:59", -363.0, 43, 0, 1, 105901, 0.0, 1, "コッコロ", "2015/12/17 15:00:00", "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。");
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (43003, 1, 0, 0.0, "2030/12/17 14:59:59", -363.0, 43, 0, 1, 106001, 0.0, 1, "キャル", "2015/12/17 15:00:00", "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！");
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (43004, 1, 0, 0.0, "2030/12/17 14:59:59", -416.5, 44, 0, 1, 123001, 0.0, 1, "アメス", "2015/12/17 15:00:00", "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪");
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (43005, 2, 0, 0.0, "2030/12/17 14:59:59", -416.5, 44, 0, 1, 123001, 0.0, 1, "アメス", "2015/12/17 15:00:00", "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！");
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (43006, 3, 0, 0.0, "2030/12/17 14:59:59", -416.5, 45, 0, 2, 123001, 5.79, 1, "アメス", "2015/12/17 15:00:00", "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？");
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (46001, 1, 0, 0.0, "2030/12/17 14:59:59", -371.5, 46, 0, 1, 123001, 0.0, 1, "アメス", "2015/12/17 15:00:00", "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。");
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (47001, 1, 0, 0.0, "2030/12/17 14:59:59", -416.5, 47, 0, 2, 104901, 0.0, 2, "シズル", "2015/12/17 15:00:00", "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪");
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (47002, 1, 0, 0.0, "2030/12/17 14:59:59", -416.5, 47, 0, 2, 101101, 9.32, 1, "リノ", "2015/12/17 15:00:00", "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪");
INSERT INTO `v1_28a7c94b4e6a23f6522c35c0bc53cedc113bb85ae72dd121ce3ed551622fc0ca` VALUES (48001, 0, 0, 0.0, "2030/12/17 14:59:59", -470.0, 48, 0, 2, 104901, 0.0, 2, "シズル", "2015/12/17 15:00:00", "");
